import React from 'react';
import { Image, SafeAreaView, Text, View } from 'react-native';

import {icons} from '../constants';

const HomeScreen = () =>{
    return(
        <SafeAreaView>
        <View>
            <Image 
            source={icons.bcs}
            style={{
                width:100,
                height:100
            }}
             />
        </View>
        </SafeAreaView>
    )
}

export default HomeScreen;
